import React from 'react';


const Home1 = ({data}) => {
    const background=`${data?.weather[0]?.main}.jpg`;
    return (
        <div className='background' style={{backgroundImage:`url(img/${background})`}}>
            <div className="container-fluid" style={{width:"50%",border:"1px solid black"}}>
                <div className="card  card-background" style={{width: "18rem"}}>
                    <div className="card-body">
                        {data?.weather[0]?.main}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Home1;
